import styled from 'styled-components';

export const Pricing = styled.div`
  position: absolute;
  width: 360px;
  height: 224px;
  margin-left: 544px;
  margin-top: 168px;

  background: #FFFFFF;
  border-radius: 4px;
`
export const DetailedPrice = styled.div`
  width: 80%;
  height: 5%;
  display: flex;
  justify-content: space-between;
  font-size: 18px;
  margin-top: 16px;
  margin-left: 16px;
`
